import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createAppContainer } from 'react-navigation';

import Home from './Home'
import SignUp from './SignUp'
import Login from './Login'

const StackNavigator = createStackNavigator({
    Home:{
        screen: Home,
        navigationOptions: {headerShown: false},
    },
    SignUp: {
        screen: SignUp,
        navigationOptions: { headerShown: false },
    },
    Login:{
        screen: Login,
        navigationOptions: {headerShown: false}
    },
},{//config for all screens in the stack navigator, should also specify default screen here, just don't know what that will be
    defaultNavigationOptions: {
        headerStyle: {
            backgroundColor: 'rgb(255,255,255)', //header should be the same color as the background
            shadowRadius: 0,
            shadowOffset: {
            height: 0,
        },
    },
    headerLeft: () => null,

},
//initialRouteName: 'SignUpScreen11A'
});

export default createAppContainer(StackNavigator);
